import React from "react";
import css from "@emotion/css";
import "./style.css";

const App = () => (
  <>
    <div
      css={css`
        display: flex;
        flex-direction: column;
        background-color: black;
        color: white;
        height: 100vh;
        font-size: 1.5rem;
      `}
    >
      MovieGuesser
    </div>
  </>
);

export default App;
